import Navbar from "./components/navbar";
import "./index.css";

function App() {
  return (

    <div>
      <header>
        <nav className="flex flex-wrap items-center justify-between w-full py-4 md:py-0 px-4 text-lg text-gray-700 bg-white">
          <div className="text-3xl underline">
            Hello World
          </div>

        </nav>
      </header>

    </div>
  );
}

export default App;
